        {name: "Aman" , email: "aman@gmail.com" , address: [{houseno:"125", city:"Gurugram"}]}
    ]
  return (
    <div>

      {
        user.map((item)=>
        <p>
        <Guest item={item}/>
        </p>
        )
      }
    </div>
  )
}

export default Print
